import React, { Component } from 'react';
import './App.css';
import Filter from './Filter';
import Header from './Header';

const clothes = [
  {name: "Halter Neck", type: "Shirt", vibe: "Party"},
  {name: "Spaghetti Top", type:"Shirt", vibe: "Party"},
  {name: "Cargo Pants", type:"Bottoms", vibe: "Casual"},
  {name: "LBD", type:"Dress", vibe: "Party"},
  {name: "Beach Dress", type:"Dress", vibe: "Casual"},
  {name: "Peplum Top", type: "Shirt", vibe: "Party"}, 
  {name: "Midi Dress", type: "Dress", vibe: "Party"},
  {name: "Fit and Flare", type: "Dress", vibe: "Party"},
  {name: "Satin Skirt", type: "Bottoms", vibe: "Party"},
  {name: "Denim Skirt", type: "Bottoms", vibe: "Casual"},
  {name: "Blouse", type: "Shirt", vibe: "Work"},
  {name: "Denims", type: "Bottoms", vibe: "Casual"}
]; 


class App extends Component {
  render() {
    return (

      <div id="body">
      <Header />
      <Filter items={clothes} />
      </div>
    );
  }
}

export default App;
